import "./intro.css"
import { sliderData } from '../../data'

const Intro = () => {
  return (
    <div className='intro-wrapper'>
        {
            sliderData.map((item,i)=>{
                return (
                    <div className='intro-img'>
                        <img src={item.img} alt='' />
                        <p>title</p>
                        </div>
                )
            })
        }
    </div>
  )
}

export default Intro
